  false,\n\t\"url\": null,\n\t\"notes\": \"The Office of National Marine Sanctuary
  Program (ONMS) updates and revises the management plans for each of its 13 sanctuaries.
  This process, which is open to the public, enables each site to revisit the reasons
  for sanctuary designation and assess whether they are meeting their goals, as well
  as to set new goals consistent with the mandates of the National Marine Sanctuaries
  Act. Issues raised by the public during this process are evaluated and a determination
  is made as to whether they will be incorporated into the updated plan. Many of these
  issues focus on topics such as the implementation of marine zoning or sanctuary
  boundary adjustments, both of which require information on the distribution of resources
  within and around the sanctuary. Recognizing this, ONMS and NOAA's National Centers
  for Coastal Ocean Science (NCCOS) formalized an agreement to collaborate in the
  revision process by developing such information through a series of biogeographic
  assessments conducted in selected sanctuaries. The resulting products are then supplied
  to sanctuary managers and staff for use in the policy and decision making process.
  This collaborative effort began along the west coast of the U.S. with the Cordell
  Bank, Gulf of Farallones, and Monterey Bay national marine sanctuaries, and is herein
  centered on the Channel Islands National Marine Sanctuary (CINMS).\",\n\t\"owner_org\":
